# Default ruleset is loaded from a pickle file
# Resons: 
# - Faster
# - No need to parse half-broken TOML files
# - Python doesn't play well with non-python files in packages (e.g. pyInstaller/wasm/etc.)

def get_default_ruleset():
    """Returns the default ruleset as a SnafflerRuleSet object"""
    from pysnaffler.ruleset import SnafflerRuleSet
    return SnafflerRuleSet.unpickle(
        b''
    )
